import React, { useState, useEffect } from 'react';
import { MapContainer, TileLayer, Marker, Popup, useMapEvents } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';
import './Game.css';


// Remove the default icon warning
delete L.Icon.Default.prototype._getIconUrl;
L.Icon.Default.mergeOptions({
  iconRetinaUrl: require('leaflet/dist/images/marker-icon-2x.png'),
  iconUrl: require('leaflet/dist/images/marker-icon.png'),
  shadowUrl: require('leaflet/dist/images/marker-shadow.png'),
});

const Game = () => {
  const [currentLocation, setCurrentLocation] = useState(null);
  const [userPosition, setUserPosition] = useState(null);
  const [distance, setDistance] = useState(null);
  const [gameStarted, setGameStarted] = useState(false);
  const [revealAnswer, setRevealAnswer] = useState(false);

  const ClickHandler = () => {
    useMapEvents({
      click: handleMapClick,
    });
    return null;
  };

  const fetchNewLocation = async () => {
    try {
      const response = await fetch('http://localhost:5000/api/get-location');
      if (!response.ok) throw new Error('Network response was not ok');
      const data = await response.json();
      setCurrentLocation(data);
      setGameStarted(true);
      setUserPosition(null);
      setDistance(null);
      setRevealAnswer(false);
    } catch (error) {
      console.error('Error fetching location:', error);
    }
  };

  const handleMapClick = (e) => {
    if (revealAnswer) return; // guess already made
    setUserPosition(e.latlng);

    if (currentLocation) {
            fetch('http://localhost:5000/api/check-distance', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          target_lat: currentLocation.lat,
          target_lng: currentLocation.lng,
          user_lat: e.latlng.lat,
          user_lng: e.latlng.lng
        })
      })
      .then(res => res.json())
      .then(data => {
        setDistance(data.distance);
        setRevealAnswer(true);
      })
      .catch(err => console.error('Error checking distance:', err));

    }
  };

  return (
    <div className="game-container">
      <div className="game-header">
        <h1>Boston Location Game</h1>
        <button onClick={fetchNewLocation} disabled={false}>
          {gameStarted ? 'New Location' : 'Start Game'}
        </button>
      </div>

      <div className="play-area">
        <div className="image-pane">
          {currentLocation && (
            <>
              <h2 className="section-title">Find this location</h2>
              <img 
                src={currentLocation.image} 
                alt={currentLocation.name}
                referrerPolicy="no-referrer"
              />
              <p className="hint-text">Click on the map to guess the location</p>
            </>
          )}
        </div>
        <div className="map-pane">
          {distance !== null && (
            <div className="result-info">
              Your guess was {distance} km away
            </div>
          )}
          <MapContainer 
            center={[42.3601, -71.0589]} 
            zoom={13}
            style={{ height: '600px', width: '100%' }}
          >
            <ClickHandler />
            <TileLayer
              url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
              attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            />
            {revealAnswer && currentLocation && (
              <Marker position={[currentLocation.lat, currentLocation.lng]}>
                <Popup>{currentLocation.name}</Popup>
              </Marker>
            )}
            {userPosition && (
              <Marker position={userPosition}>
                <Popup>
                  Your guess
                  {distance !== null && <p>Distance: {distance} km</p>}
                </Popup>
              </Marker>
            )}
          </MapContainer>
        </div>
      </div>
    </div>
  );
};

export default Game;
